import React from "react";
import "./style.css";
import Resume from"./cory-quirk-dec2020resume.pdf";

function Contact(props) {
  return (
    <div class="contact">
      <h1 class="xxlarge">contact me</h1>
      <hr />
      <a href="https://www.linkedin.com/in/cory-quirk/" target="_blank"><button class="contactBtns">
        <span><h3>LinkedIn <i class="fa fa-linkedin"></i></h3></span></button></a>
        <a href={Resume} target="_blank"><button class="contactBtns"><span><h3>Resum√© <i class="fa fa-file"></i></h3></span></button></a>
        <a href="mailto:coryjquirk@gmail.com" target="_blank"><button class="contactBtns"></button></a>
        <button class="contactBtns ">
        <span><h3>Email <i class="fa fa-envelope"></i></h3></span>
      </button>
      <a href="https://github.com/coryjquirk" target="_blank"><button class="contactBtns"><span><h3>GitHub <i class="fa fa-github"></i></h3></span></button></a>
    </div>
  );
}

export default Contact;
